import React from 'react';
const Header = (props) =>{
    return(
        <header className="header-data">
            <ul>
                <li>
                    <a href="{props.Hlinks}">{hname}</a>
                </li>
                <li>
                    <a href="{props.Hlinks}">About Us</a>
                </li>
                <li>
                    <a href="{props.Hlinks}">Contact Us</a>
                </li>
            </ul>
        </header>
    );
}
export default Header;
